          LOOP
            sql := sql || format('SELECT ''%I'' AS tenant, * FROM %I.%I UNION ALL ', schema, schema, table_name);
          END LOOP;

          EXECUTE
            format('CREATE OR REPLACE VIEW %I AS ', table_name) || left(sql, -11);
        END
